import React, { Component } from 'react';

class FetchProducts extends Component{
    constructor(props){
        super(props);
        this.state = {
            products: [],
        };
    }

    componentDidMount(){
        fetch('https://shopping-cart-demo-api.herokuapp.com/products')
        .then(resp => resp.json())
        .then(data => {
            const products = data;
        })
        this.setState({products});
        console.log("state", this.state.products);

    }
    render(){
        return "sdfsdf";
    }
}
